export default function Main({filter, list}){
  let productList
  let categoryList
  let exhibitionList
  let brandList
  useEffect(()=>{
    productList = list.filter(el=>el.type==='Product')
    categoryList = list.filter(el=>el.type==='Category')
    exhibitionList = list.filter(el=>el.type==='Exhibition')
