  },[])
  console.log(productList)
  const items = list
  // [productList[0],categoryList[0],exhibitionList[0],brandList[0]]
  return(
    <article id='main'>
      <section>
      <dl>
        <dt>상품 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} />
          })}
        </dd>
        <dt>북마크 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} />
          })}
        </dd>
      </dl>
      </section>
    </article>
  )
}
